              content:
                "Rozdrobniony przez zęby pokarm jest mieszany przy udziale języka ze śliną. Ślinę wydzielają trzy parzyste gruczoły ślinowe zwane **śliniankami** (ślinianka przyuszna, podżuchwowa i podjęzykowa) oraz drobne gruczoły rozsiane w całej jamie ustnej. Ilość wydzielanej śliny zależy od pH i konsystencji pokarmu. Pokarm kwaśny i suchy zwiększa ilość wydzielanej śliny. Zawarty w ślinie śluz zmiękcza rozdrobniony pokarm, zlepia go, ułatwia formowanie kęsów pokarmowych i ich połykanie. W ślinie znajdują się również: substancje bakteriobójcze niszczące drobnoustroje, które dostają się do jamy ustnej wraz z pożywieniem, substancje neutralizujące kwaśne składniki pokarmowe (by chronić szkliwo) oraz enzymy trawienne do trawienia cukrów.\n\n\nJama ustna łączy się z **gardłem**. Jest to wspólny odcinek dróg oddechowych i pokarmowych. Za gardłem położona jest krtań, narząd układu oddechowego. Przeważnie wejście do krtani pozostaje otwarte (gdy mówimy i oddychamy). Podczas przełykania krtań jest zamykana przez chrząstkę zwaną nagłośnią. Sprawia ona, że pokarm dostaje się nie do układu oddechowego, lecz do przełyku.\n\n\n**Przełyk** to umięśniona rurka wiodąca do żołądka. Obecne w ścianie gardła i przełyku mięśnie gładkie, kurcząc się rytmicznie, wykonują **ruchy perystaltyczne** (zwane także robaczkowymi), które przesuwają pokarm do żołądka.",
