              content:
                "**Żołądek** położony jest w jamie brzusznej poniżej mostka, nieco po lewej stronie. Przypomina grobościenny, rozciągliwy worek o pojemności ok. 1,5 l, w którym pokarm jest okresowo magazynowany (nawet do 8 godzin) i poddawany dalszej obróbce chemicznej. Obecne w ścianie żołądka gruczoły wydzielają sok żołądkowy, w skład którego wchodzą przede wszystkim enzymy trawienne rozkładające białka oraz kwas solny. Ten ostatni niszczy połknięte drobnoustroje i pobudza mięśnie ściany żołądka do skurczów, co ułatwia mieszanie pokarmu z enzymami i przesuwanie go do jelita. Produkowany w żołądku śluz zabezpiecza jego ściany przed niszczącym wpływem kwaśnego soku żołądkowego oraz działaniem enzymów trawiennych (czyli samostrawieniem).\n\n\n\nŚrodkową, najdłuższą część przewodu pokarmowego stanowi **jelito cienkie** o długości ponad 6 m, którego początkowy odcinek nosi nazwę **dwunastnicy**. Znajduje się ono w jamie brzusznej poniżej żołądka. Tu odbywa się dalszy etap trawienia pokarmu. W ścianie jelita cienkiego znajdują się gruczoły wydzielające m.in. enzymy trawienne. Do dwunastnicy uchodzą przewody prowadzące z wątroby i trzustki.\n\n**Wątroba** to największy gruczoł organizmu, położony w górnej części jamy brzusznej, po prawej stronie. Produkuje i wydziela żółć, która spływa do pęcherzyka żółciowego, gdzie jest okresowo magazynowana i zagęszczana. W wątrobie zachodzą różnorodne procesy metaboliczne, dlatego krew ogrzewa się podczas przepływania przez nią, a następnie rozprowadza ciepło po całym organizmie. W ten sposób wątroba uczestniczy w utrzymaniu stałej temperatury ciała. Wątroba jest rodzajem filtra, przez który przechodzi pokarm wchłonięty do krwi z jelita. Zanim dotrze on do komórek, musi być pozbawiony trucizn, np. alkoholu, a także składników leków.\n\n**Trzustka** to gruczoł położony poniżej żołądka, który pełni dwie ważne dla organizmu funkcje: wewnątrzwydzielniczą, polegającą na wytwarzaniu hormonów, oraz  zewnątrzwydzielniczą, polegającą na produkcji enzymów trawiennych rozkładających białka, cukry i tłuszcze.",
