                "W lecie na czele rządu stanął Aleksander Kiereński. W sierpniu doszło do nieudanego zamachu stanu gen. Ławra Korniłowa – mianowanego naczelnym wodzem − który zamierzał przywrócić w Rosji monarchię. Na prowincji chłopi grabili dwory i zajmowali pańską ziemię (realizując hasło Lenina „grab zagrabione” i wydając wojnę „burżuazji”). Radykalne grupy zasilali uciekinierzy z frontu. Nastąpił całkowity rozkład armii i państwa.\n\n## Rewolucja październikowa\n\nMimo radykalnych nastrojów społecznych bolszewicy wciąż byli niewielką grupą: na I Wszechrosyjskim Zjeździe Rad w czerwcu 1917 r. stanowili 11 proc. Kiedy rząd zapowiedział wybory do Zgromadzenia Ustawodawczego, dla bolszewików oznaczało to usunięcie ich ze sceny politycznej. Nie mieli szans na objęcie władzy w legalnych wyborach, mimo że we wrześniu zdobyli większość w Piotrogrodzkiej Radzie Delegatów Robotniczych i Żołnierskich, głównie dzięki hasłom cała władza w ręce rad oraz „pokój i ziemia”. Jedynym rozwiązaniem był dla nich zamach stanu.\n\nNa 7 listopada (25 października według kalendarza juliańskiego) zaplanowano początek II Kongresu Zjazdu Rad, który miał zadecydować o dalszej polityce państwa. Lenin obawiał się, że uchwalony zostanie pokój, co oznaczałoby odebranie bolszewikom narzędzia propagandowego. W nocy z 6 na 7 listopada (z 24 na 25 października według kalendarza juliańskiego) rozpoczęli więc pucz: Gwardia Czerwona podległa Komitetowi Wojskowo‑Rewolucyjnemu aresztowała członków rządu i opanowała główne punkty Piotrogrodu. Był to początek rewolucji, nazwanej później październikową. Delegaci Zjazdu Rad na znak protestu opuścili obrady, bolszewicy przejęli kontrolę i wydali dwa dekrety: o ziemi oraz o pokoju. Pierwszy ogłaszał nacjonalizację ziemi i przekazanie jej chłopom w użytkowanie, drugi był deklaracją zakończenia wojny. Powołana została też Rada Komisarzy Ludowych jako najwyższa władza w Rosji.",
